import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import ItemChooser from './components/items/detail/itemChooser';
import Routes from './routes/routes';
import { obtenerHelados } from './data/item';
import DtItem from './dataTypes/item';
import ItemCategory from './dataTypes/itemCategory';
import { useState } from 'react';


function App() {

  const items = obtenerHelados().filter((i: DtItem) => i.category === ItemCategory.Recipiente);
  const [selectedItems, setselectedItems] = useState([items[0],items[1],items[2]])

  return <div id="app">
    {/*<Routes />*/}
    
    < ItemChooser 
      imgWidth={500}
      items={items}
      selectedItems={selectedItems}
      setSelectedItems={setselectedItems}
    />
  </div>
}

export default App;
